import React, { useState, useEffect } from "react";

export const RightBranch = () => {
  const [right, setRight] = useState([]);
  const [disable, setDisable] = useState(false);
  const [exclusive, setExclusive] = useState(false);
  const [comm, setComm] = useState(false);
  const [tradeable, setTra] = useState(true);

  const checkTradeable = (evt) => {
    if(evt.target.value !== "PO") setTra(false);
    else setTra(true);
  }
  const checkExclusive = (evt) => {
    if(evt.target.value !== "GE") setExclusive(true);
    else setExclusive(false);
  }
  const checkCommercial = (evt) => {
    console.log(evt.target.value);
    if(evt.target.value !== "GE") setComm(true);
    else setComm(false);
  }
//   const checkRight = (evt) => {
//     if(evt.target.value === 'RA'){
//       if(disable) setDisable(false);
//       else setDisable(true);
//     }
//     else{
//       let rightStr = '';
//     }
//   }
  const checkRight = (evt) => {
    if (right.includes(evt.target.value)) {
      setRight(
        right.filter((checkedValue) => checkedValue !== evt.target.value)
      );
    } else {
      setRight([...right, evt.target.value]);
    }
  };
  return(
    <>
      권리의 독점적 이용 가능 여부 지정<br/>(독점적 이용허락시 발행가능 NFT 갯수는 1개로 제한됨)<br/>
      <label><input type="radio" value="EX" onChange={checkExclusive} name='exclusive'/>
        독점적 이용 허가 </label>
      <label><input type="radio" value="GE" onChange={checkExclusive} name='exclusive'/>
        단순 이용 허가 </label><br/>
      <br/>저작권 이용 가능 여부 지정<br/>
      <label><input type="radio" value="CO" onChange={checkCommercial} name='comm'/>
        상업적 이용 허가 </label>
      <label><input type="radio" value="NC" onChange={checkCommercial} name='comm'/>
        비영리적 이용 허가 </label>
      <label><input type="radio" value="GE" onChange={checkCommercial} name='comm' defaultChecked/>
        개인 소유권만 인정 </label><br/>
      {comm ? 
      <>
        <br/>허가할 이용 범위 지정<br/>
        {/* <label><input type="checkbox" value="RA" checked={right.includes("RA")} onChange={checkRight} name='right'/>
        모든 권리</label> */}
        <label><input type="checkbox" value="RR" checked={right.includes("RR")}onChange={checkRight} disabled={disable}/>
        복제권</label>
        <label><input type="checkbox" value="RD" checked={right.includes("RD")}onChange={checkRight} disabled={disable}/>
        배포권</label>
        <label><input type="checkbox" value="RDW" checked={right.includes("RDW")}onChange={checkRight} disabled={disable}/>
        2차적 저작물 작성권</label>
        <label><input type="checkbox" value="RE" checked={right.includes("RE")}onChange={checkRight} disabled={disable}/>
        전시권</label>
        <label><input type="checkbox" value="RPP" checked={right.includes("RPP")}onChange={checkRight} disabled={disable}/>
        공연권</label>
        <label><input type="checkbox" value="RPT" checked={right.includes("RPT")}onChange={checkRight} disabled={disable}/>
        방송권</label><br/>
      </> : <></>}
      <br/>3자 거래 가능여부 선택<br/>
      <label><input type="radio" value="PO" onChange={checkTradeable} name='exclusive'/>
        가능함 </label>
      <label><input type="radio" value="DI" onChange={checkTradeable} name='exclusive'/>
        불가함 </label><br/>
    </>
  )
}
